import Table from "../../styled-components/Table";
import Typography from "../../styled-components/Typography";

export default function Challenge() {
  return (
    <Table hint>
      <Typography hint href="/">
        The Witcher
      </Typography>
      <Typography hint href="/">
        Skyrim
      </Typography>
      <Typography hint href="/">
        Kingdom Come
      </Typography>
      <Typography hint href="/">
        Gothic
      </Typography>
    </Table>
  );
}
